import React from 'react'
import { Link } from 'react-router-dom'

function Navbar(){

    return(
        <nav className="Navbar">
            <h1>FAST</h1>
            <div className="links">
                <Link to="/">Home</Link>
                <Link to="/Connect">Connect</Link>
                <Link to="/Challanges">Challanges</Link>
                <Link to="/About">About</Link>
            </div>
        </nav>
    )
}

export default Navbar;
